(window.webpackJsonp=window.webpackJsonp||[]).push([[7],{"resources/elements/about-page":function(e,n,t){"use strict";t.r(n),t.d(n,"AboutPage",function(){return c});var o=t(68),i=t(50),a=t(12),s=function(e,n,t,o){var i,a=arguments.length,s=a<3?n:null===o?o=Object.getOwnPropertyDescriptor(n,t):o;if("object"==typeof Reflect&&"function"==typeof Reflect.decorate)s=Reflect.decorate(e,n,t,o);else for(var r=e.length-1;r>=0;r--)(i=e[r])&&(s=(a<3?i(s):a>3?i(n,t,s):i(n,t))||s);return a>3&&s&&Object.defineProperty(n,t,s),s},r=function(e,n){if("object"==typeof Reflect&&"function"==typeof Reflect.metadata)return Reflect.metadata(e,n)},c=function(){function e(e,n){this.ss=e,this.ps=n}return e.prototype.attached=function(){this.ss.setSocialTags({title:"About | Burmese Lexicon",description:document.querySelector(".summary").textContent}),this.ps.setPrerenderReady()},e=s([a.d,r("design:paramtypes",[i.a,o.a])],e)}()},"resources/elements/about-page.html":function(e,n,t){e.exports="<template>\n  <require from='./about-page.scss'></require>\n\n  <div class=\"ui warning message\">\n    Only unicode is supported as of now. Zawgyi users will run into issues.\n  </div>\n  <section class='summary'>\n    <p>\n      Burmese Lexicon ကို စတင်လုပ်ရခြင်းမှာ မြန်မာစကားလုံးများကို အွန်လိုင်းတွင် အလွယ်တကူ ရှာမရခြင်းကြောင့် ဖြစ်ပါတယ်။\n      ရှိပြီးသား အွန်လိုင်းအဘိဓာန်များမှာလည်း မစုံလင် ခြင်း၊ လူများစု ပူးပေါင်းပြီး လွတ်လပ်စွာ ထည့်သွင်းနိုင်ခြင်း မရှိခြင်းကြောင့်ပါ။\n    </p>\n    <p>\n      မြန်မာ Wiktionaryမှာလည်း မြန်မာစကားလုံးများ တော်သင့်သလောက်ရှိနေပါပြီ။ ဒါပေမဲ့ အထောက်အထား၊ အကိုးအကားလိုအပ်တတ်ခြင်းကြောင့်\n      လူများစု လွယ်လွယ်နဲ့ ဝင်မရေးဖြစ်ကြပါ။ ဒါကြောင့် အခုလို ပေ့ါပေ့ါပါးပါး ကိုယ်သိသလောက် ဝင်ရေးနိုင်အောင် စီစဉ်ထားပါတယ်။ ဝေါဟာရများကို အနှစ်ချုပ်ပြီး လူတိုင်းချက်ချင်း နားလည်နိုင်အောင်\n      ရည်ရွယ်ပါတယ်။\n      စာအထောက်အထားနှင့် အကျယ်ရှင်းချင်သူများအတွက်ကတော့ Wiktionary မှာ ပိုသင့်လျော်ပါတယ်။ Burmese Lexicon မှလည်း အခြားဆုိက်ဒ်များကို ပြန်လည် ဝေမျှသွားနိုင်ဖို့ လုပ်မှာပါ။\n    </p>\n    <p>\n      လူမှူရေး၊ ဘာသာရေး၊ နုိင်ငံရေး၊ အသက်မေွးဝမ်းကျောင်းနှင့် ပတ်သက်သော ဝေါဟာရများကို မိမိလက်လှမ်းမှီသလောက် ဖြည့်စွက်သွားဖို့\n      ဖိတ်ခေါ်ပါတယ်။ Burmese Lexicon သည် အမြဲ Open-source နှင့် Free of Charge ဖြစ်ပြီး ဒီဇိုင်း၊ ကုတ်၊ အကြံပေးခြင်း အစရှိသဖြင့် လိုအပ်သလို\n      <a href='https://github.com/burmese-lexicon/burmese-lexicon'>ဒီမှာ</a> ဝင်ရောက်ကူညီနိုင်ပါတယ်။\n      သို့မဟုတ် <a href='mailto:burmeselexicon@gmail.com'>burmeselexicon@gmail.com</a> သို့ အီးမေးလ်ပေးပို့နုိင်ပါသည်။\n    </p>\n  </section>\n\n  <section>\n    <h1>မြန်မာစာရေးရန် လိုအပ်သည်များ</h1>\n    <ul>\n      <li><a href='https://itunes.apple.com/us/app/gboard/id1091700242?mt=8'>Google keyboard on iOS</a></li>\n      <li><a href='https://play.google.com/store/apps/details?id=com.google.android.inputmethod.latin&hl=en_US'>Google keyboard on play store</a></li>\n      <li><a href='https://play.google.com/store/apps/details?id=com.touchtype.swiftkey&hl=en_US'>Swift keyboard</a></li>\n    </ul>\n    <p>မြန်မာစာကို လက်ရေးနှင့်လည်း Google keyboard ဖြင့် အလွယ်တကူ ရေးနုိင်ပြီ ဖြစ်ပါတယ်။</p>\n    <div class='handwriting-images'>\n      <figure>\n        <img class='ui image' src='/images/keyboard-instructions-1.gif'>\n        <figcaption>Keyboard usage</figcaption>\n      </figure>\n      <figure>\n        <img class='ui image' src='/images/keyboard-instructions-2.gif'>\n        <figcaption>Keyboard setup</figcaption>\n      </figure>\n    </div>\n  </section>\n  <figure>\n    <img class='ui image' src='http://www.unicode.today/wp-content/uploads/2016/09/Myanmar3_Unicode_keyboard_Layout.jpg' alt='keyboard-layout'>\n    <figcaption>Myanmar Unicode Keyboard Layout</figcaption>\n  </figure>\n</template>\n"},"resources/elements/about-page.scss":function(e,n,t){(e.exports=t(44)(!1)).push([e.i,".about-page p, .about-page ul {\n  text-align: left; }\n\n.about-page .handwriting-images {\n  display: flex;\n  flex-wrap: wrap; }\n\n.about-page section {\n  margin-bottom: 2em; }\n",""])}}]);
